insert into tds_coremessageobject values ('Default.aspx','ServerSide',11028,'Student','StaticContent.Label.PTIntroText','<div class="blurb"><a class="gridlink" target="_blank" href="https://airpt.tds.airast.org/grid/default.aspx">Click here to learn how to answer technology-enhanced questions.</a> </p> </div> <!-- <div class="blurb"><p>Welcome to the Training Test site. You can use this site to take sample tests online to become familiar with the online testing environment. Some of the questions will require you to select one answer; others may require you to type a short answer, draw a picture, or complete another type of open-ended task.</p></div><div class="blurb"><p>Interactive tutorial: <a class="gridlink" target="_self" href="https://dept.tds.airast.org/grid/default.aspx">Click here to learn how to answer technology-enhanced questions.</a></p></div><div class="blurb"><p><strong> you must use Mozilla Firefox or the Secure Browser as your Internet browser to access the Training Test.</strong> Internet Explorer and Safari will not work with this site. <a class="linkbox" target="_self" href="http://www.mozilla.com/en-US/firefox/all-older.html">Click here to download Firefox for Windows, Mac OS X, and Linux.</a></p></div> -->',null,2497,null,'2012-05-03 19:17:36.590',null,NULL);
insert into tds_coremessageobject values ('Default.aspx','ServerSide',11029,'Student','StaticContent.Label.OpLoginText','<p>Welcome to AIR Online!</p><ol type="1"><li>Enter your first name, SSID and the Session ID in the fields above. Your Test Administrator will give you the Session ID.</li><li>Click [Sign In] to continue.</li></ol>',null,2498,null,'2012-05-03 19:17:36.590',null,NULL);
insert into tds_coremessageobject values ('Default.aspx','ServerSide',11030,'Student','StaticContent.Label.PTLoginText','<p>To log in with your student account (using Name / SSID):</p><ul><li>Uncheck the "Guest User" checkbox (both fields will become blank)</li><li>Enter your First Name and SSID in the fields above.</li></ul><p>To log in as a Guest (anonymous user):</p><ul><li>Mark the "Guest User" checkbox (both fields will automatically display Guest)</li><li>Click [Sign In] to login to the Training Test as a guest user.</li></ul><p><em>Guest Session?</em><br />In a Guest Session, you do not need Test Administrator approval and can take a Training Test using your own settings. To take a Training Test in a session with a Test Administrator, uncheck the “Guest Session” checkbox and enter the Session ID in the field before clicking [Sign In].</p>',null,2499,null,'2012-05-03 19:17:36.590',null,NULL);
