insert into tds_coremessageobject values ('Lookup.aspx','ClientSide',10538,'Proctor','Label.Instructions','<p>Enter the student’s full Student ID (SSID) and click [Submit SSID] to search for that student’s record. A record displays the student’s name, birth date, grade, and school/district information. Searches by partial SSID are not permitted.</p><br/><p>Note: This Student Lookup feature allows you to verify student information for login purposes only. It does not indicate whether a student is eligible to test. To verify student eligibility for a specific online assessment, please check TIDE.</p>',null,3210,null,'2012-05-03 19:17:37.860',null,NULL);
