insert into tds_coremessageobject values ('PrintRequest.aspx','ClientSide',10557,'Proctor','Label.Instructions','<p>To print the requested content, click the [Print] button below. This will print the following pages: 1) cover sheet at the beginning and end of the printout that includes the student name and policies on security and privacy, 2) pages containing the requested test content.  In addition, clicking the button closes this window.</p>  <br />  <p>It is important to adhere to the security and privacy policies for this procedure.</p>',null,3229,null,'2012-08-13 14:04:17.860',null,NULL);
insert into tds_coremessageobject values ('PrintRequest.aspx','ClientSide',10558,'Proctor','Label.PrintMessage2','<h2>AIR Secure Test Material</h2><p><strong>This printout contains secure test content and must be immediately and securely recycled on-site by authorized school staff.</strong></p><p>Do not photocopy, enlarge, digitize, or  retain printouts of test content. Such actions constitute a severe test security violation and must be reported to state department of education.</p><p>In accordance with the Family Educational Rights and Privacy Act (FERPA), disclosure of personally identifiable information protected by privacy laws is prohibited. Please securely destroy all printed test content immediately after the end of this testing session.</p>',null,3230,null,'2012-05-03 19:17:37.860',null,NULL);
insert into tds_coremessageobject values ('PrintRequest.aspx','ClientSide',10559,'Proctor','Label.PrintMessage1','<h2>AIR Secure Test Material</h2><p><strong>This printout contains secure test content and must be immediately and securely recycled on-site by authorized school staff.</strong></p><p>Do not photocopy, enlarge, digitize, or retain printouts of test content. Such actions constitute a severe test security violation and must be reported to the state department of education.</p><p>In accordance with the Family Educational Rights and Privacy Act (FERPA), disclosure of personally identifiable information protected by privacy laws is prohibited. Please securely destroy all printed test content immediately after the end of this testing session.</p>',null,3231,null,'2012-05-03 19:17:37.860',null,NULL);
insert into tds_coremessageobject values ('Requests.aspx','ClientSide',10560,'Proctor','Label.Instructions','<p>This page displays a request for each passage or item that a student would like printed.  Click [Approve] if you approve the print request, or [Deny] if you do not.</p><p>Note: Clicking [Approve] brings up a Print Preview page based on the browser you are using.  Click [Print] from that page to send this request to your print station.</p>',null,3232,null,'2012-05-03 19:17:37.860',null,NULL);
