insert into tds_coremessageobject values ('SystemReports.aspx','ClientSide',10610,'Reports','GetGeographicLatencies.Notes','<h2>Legend</h2><p><strong>Latency</strong>—How long it takes the system to generate a request</p><p><strong>Client-selection</strong>—The amount of time in milliseconds the browser waits when it requests the next item group from the adaptive selection algorithm (including all SSL encryptions/decryptions)</p><p><strong>Client-review</strong>—The amount of time the browser waits when it requests a previously-selected item group for review (including SSL)</p><p><strong>Server-selection</strong>—The amount of time the server requires to complete an item-selection request (does not include SSL encryption/decryption)</p><p><strong>Server-review</strong>—The amount of time the server requires to complete an item-group review request (not including SSL)</p><p><strong>Min/max/mean ms</strong>—The minimum, maximum and mean time (in milliseconds) taken to generate the request </p><p><strong>dbmin/dbmax/dbmean</strong>—The amount of the server overall time consumed by the dominant database query </p>',null,3333,null,'2012-05-03 19:17:37.927',null,NULL);
