insert into client_messagetranslation values (2499,'AIR','<p>Para iniciar sesión con una cuenta de estudiante (con Nombre / SSID):</p><ul><li>desactive la selección de la casilla de verificación “Usuario invitado” (ambos campos aparecerán vacíos)</li><li>Ingrese su nombre y SSID en esos campos.</li></ul><p>Para iniciar sesión como invitado (usuario anónimo):</p><ul><li>Marque la casilla de verificación "Usuario invitado" (ambos campos mostrarán automáticamente Invitado)</li><li>Haga clic en [Iniciar sesión] para iniciar sesión en la prueba de muestra como usuario invitado.</li></ul><p><em>¿Sesión de invitado?</em><br />En una sesión de invitado, no necesita la aprobación del administrador de la prueba, por lo que puede realizar la prueba con su propia configuración. Para realizar la prueba de muestra en una sesión con el administrador de la prueba, desactive la selección de la casilla de verificación “Sesión de invitado” e ingrese el id. de sesión en el campo antes de hacer clic en [Iniciar sesión].</p>','ESN','--ANY--','--ANY--',UNHEX(REPLACE('70B75D99-40DE-4628-815C-33E3380A1A78','-','')),'2013-08-01 11:02:31.780');
