insert into client_messagetranslation values (2499,'AIR','<p>No ke komo ʻana i kou waihona haumāna (ma ka inoa/helu haumāna) :</p><ul><li> E holoi i ka māka o loko o ka pahu no ka "Haumāna Kipa"</li><li> E hoʻokomo ʻoe i kou Inoa Mua a me kou Helu Haumāna i loko o nā puka o luna. </li></ul><p> No ke kāinoa ʻana ma ke ʻano he haumāna (Haumāna Kipa) :</p><ul><li> E māka i ka pahu no ka "Haumāna Kipa" (E ʻike ʻia ʻo Haumāna Kipa ma nā wahi ʻelua) </li><li> E kaomi i ke [Kāinoa] no ke omo ʻana i ka Hōʻike Hoʻomaʻamaʻa ma ke ʻano he haumāna kipa. </li></ul><p><em> Wā Hana Haumāna Kipa? </em><br />Ma loko o ka Wā Hana Haumāna Kipa, ʻaʻole pono ka ʻāpono ʻana mai o ka luna hōʻike a hiki iā ʻoe ke hana i kekahi Hōʻike Hoʻomaʻamaʻa me ka hoʻohana ʻana i kou mau hiʻohiʻona. No ka hana ʻana i ka Hōʻike Hoʻomaʻamaʻa ma kekahi wā hana me ka luna hōʻike, e holoi i ka māka o ka pahu no ka "Wā Hana Haumāna Kipa" a e hoʻokomo i ka Helu Wā Hana i nā puka ma mua o ke kaomi ʻana i ka [Kāinoa]. </p>','HAW','--ANY--','--ANY--',UNHEX(REPLACE('5C35FB84-4EDE-4119-BE0C-AF879F347C79','-','')),'2013-08-01 11:02:31.780');
insert into client_messagetranslation values (3619,'AIR','E holoi ?ia ana na ?ikepili a pau no keia ?ikemu ina hana ?ia keia.Makemake a nei ?oe e ho?omau aku?<br/><br/> ?Olu?olu e kaomi i ka pihi [?Ae] no ka holoi ?ana i na ?ikepili a pau.Kaomi i ka pihi [Ho?ole] no ke kapae ?ana i keia hana.','HAW','--ANY--','--ANY--',UNHEX(REPLACE('20C2B202-FC6B-49E3-87E6-AFA587C682CD','-','')),'2013-12-18 14:09:07.503');
