insert into client_messagetranslation values (3230,'SBAC','<h2>Smarter Balanced Assessments Secure Test Material</h2>  <br />  <p><strong>This printout contains secure test content and must be immediately and securely recycled on-site by authorized school staff.</strong></p><p>Do not photocopy, enlarge, digitize, or  retain printouts of test content. Such actions constitute a severe test security violation and must be reported to Smarter Balanced.</p>  <p>In accordance with the Family Educational Rights and Privacy Act (FERPA), disclosure of personally identifiable information protected by privacy laws is prohibited. Please securely destroy all printed test content immediately after the end of this testing session.</p>','ENU','--ANY--','--ANY--',UNHEX(REPLACE('00227655-08EA-44B4-A2CA-C6BFFDCEBE53','-','')),'2013-08-01 14:17:09.583');
