insert into client_messagetranslation values (3385,'AIR','<p>Hiki ?ia?oe ke ho?ohana i keia ?ao?ao no ka loa?a ?ana o na ho?ike kahua like ?ole.Loa?a keia mau mea:</p><ul><li>Na palapala ho?ike helu mea ho?ohana. Hiki ke nana i ka nui o na TA a me no ka nui o na haumana ma ka wa ho?ohana ma na halo pakahi a me na la pakahi.</li><li>Na palapala ho?ike no na lohi ma ka ?ao?ao o ke kahua ha?awi ho?ike a me ka ?ao?ao o ka mea ho?ohana. Nana na ?ikepili lohi no na kahua ha?awi ho?ike a me na mea ho?ohana (?a?ao o ka mea ho?ohana).</li><li>Palapala Ho?ike Ki?i kukulu – Nana i na ha?awina i makemake ?ia e pili ana i na kahu ha?awi ho?ike pakahi.</li><li>Na ho?ike ho?omau ?ano?e: E nana he aha ke ?ano o na polokalamu punaewele puni honua a me na polokalamu kahua i ho?ohana ?ia i ka manawa i ka inoa ?ano ?e ?ia ai.</li></ul>','HAW','--ANY--','--ANY--',UNHEX(REPLACE('B71FC628-5603-4545-A25B-CBB7C0D1860E','-','')),'2013-12-18 14:09:07.170');
